import React from 'react';
import {Col} from "react-bootstrap";

const newblock = {
    backgroundColor: "whitesmoke",
    borderRadius: "50px",
    display: "block",
    width: "1200px",
    height: "600px",
    textAlign: "center",
    marginLeft: "220px",
    marginTop: "40px",
    alignContent: "center"
}

export const Help = () => (
    <div style={newblock}>
        <div style={{alignContent: 'left', marginLeft: '10px', marginTop: '20px', fontSize:'1.8em', fontWeight:'bold'}}> User Dashboard</div>
        <div style={{alignContent: 'left', marginLeft: '10px', marginTop: '20px', fontSize:'1em'}}> To generate a new report, click on the new graph.</div>
    </div>
)
